import { useParams } from 'react-router-dom';
import { Fragment } from 'react';

const RecipeDetail = () => {
    const params = useParams();

    return(
        <Fragment>
            <h1>page</h1>
            <p>{params.recipeId}</p>
        </Fragment>
    )
};

export default RecipeDetail;
